import React, { Component } from 'react';

class LoginForm extends Component {

  render() {
    return (
      <div>
        <form>
          <label>
            Username:
            <input type="text" name="username"></input>
          </label>
          <label>
            Password:
            <input type="password" name="password"></input>
          </label>
          <input type="submit">Log in!</input>
        </form>
      </div>
    );
  }

}

export default LoginForm;
